import Link from "next/link";
import { PrimaryButton } from "../Button/Button";
import { logout } from "../../store/auth/authActions";
import { connect } from "react-redux";
import {useState, useEffect, ReactElement} from "react";
import {NextRouter, useRouter} from "next/router";
import { AdminRoute as menu } from  '../../NavigationMenu'

function AdminSideDrawer(props: any): ReactElement {
    const router: NextRouter = useRouter();
    const [checked, setChecked] = useState<boolean>(false);

    useEffect(() => {
        if (!props.isAuthenticated) {
            router.push("/user/login");
        }
    }, [props.isAuthenticated]);

    // Return statement.
    return (
        <>

        <div className="sidedrawer">

        <div className="h-[50px] w-full bg-red-300">
            </div>
            <div className="">
            <ul className="space-y-2 ml-10  items-center mt-4 overflow-y-scroll">
                {menu.map((prod) => {

                    return (
                        <>
                            <h3 className="text-base font-thin">{prod.title}</h3>
                            <li className="ml-4 text-xs h-[20px]">{prod.cat}</li>
                        </>
                    )

                })}


            </ul>
            </div>

        </div>
            {/* <div>Dashboard</div>
            <Link href="/user/register">Register</Link>
            <PrimaryButton
                onClick={() => {
                    props.logout();
                }}
            >
                Logout
            </PrimaryButton> */}
        </>
    );
}
const mapStateToProps = (state: any) => ({
    isAuthenticated: state.auth.isAuthenticated,
    loading: state.auth.registerLoading,
});

export default connect(mapStateToProps, { logout })(AdminSideDrawer);
